import React from 'react';
import Menu from '../../componentes/navMenu';
import Footer from '../../componentes/footer';
import "./style.css";

function Home() {
  return (    
    <div className="tela">
        <Menu/>
        <div className="conteudo">
            <h1>Historia da Calculadora</h1>

        </div>
        <Footer/>
    </div>
  );
}
export default Home;
